import React from 'react';
import { Carousel } from 'reactstrap';
import LastVisit from './LastVisit';
import Offers from './Offers';
import Sponsor from './Sponsor';

const Home = () => {
  return (
    <>
    
    <div>
      <h1>Home</h1>
    </div>

    <section className="home-section">
      <LastVisit />
      <Offers />
      <Sponsor />
      <Carousel />
    </section> 
    
    </>
  )
}

export default Home;
